import React, { useState } from 'react'
import { userArray1 } from '../Login/Login'
import Edit from './Edit'

export default function Name() {
    const [isClicked, setIsClicked] = useState(false)

    const [isSidebarOpen, setIsSidebarOpen] = useState(false)

    const handleClick = () => {
        setIsClicked(true)
    }

    const toggleSidebar = () => {
        setIsSidebarOpen(!isSidebarOpen)
    }

    return (
        <>
            <div className={`sidebar ${isSidebarOpen ? 'open' : ''}`}>{isClicked ? <Edit /> : <></>}</div>
            <div className='name-container'>
                <div className='name'>
                    <div>
                        <div className='username'>
                            {userArray1.map((username) => (
                                <b>{username}</b>
                            ))}
                        </div>
                        <div className='username'>1234567890</div>
                        <div className='username'>dav2005@gmail.com</div>
                    </div>
                </div>
                <div className='edit'>
                    <button className='edit-profile' onClick={toggleSidebar}>
                        EDIT PROFILE
                    </button>
                </div>
            </div>
        </>
    )
}
